import React from "react";
import "./navbar.css";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div className="hero">
      <p>
        <nav className="nav1">
          <ul id="links12">
            <li><Link to="/home">Home</Link></li>
            <li><Link to="/aboutus">AboutUs</Link></li>
            <li><Link to="/login">Contact</Link></li>
          </ul>
        </nav>
      </p>
    </div>
  );
}

export default Navbar;
